Movie Info: ABCD: American-Born Confused Desi is a 2013 Malayalam comedy film directed by Martin Prakkat, produced by Shibu Thameens under the banner of Thammens Films.[2] It stars Dulquer Salmaan, Jacob Gregory Aparna Gopinath and Tovino Thomas in the lead roles. The film features music composed by Gopi Sunder, whilst cinematography is handled by Jomon T. John and is edited by Donmax.

The film deals about the journey of two young American Malayalees to their Motherland, Kerala with the title based on the term American-Born Confused Desi.

